import React from "react";
import {
  TouchableOpacity,
  TextInput,
  View,
  Text,
  Alert,
  Image,
} from "react-native";
import { Formik } from "formik";
import { StyleSheet } from "react-native-web";

const LoginScreen = () => {
  const handleNavigationToHome = () => {
    Alert.alert("hola");
  };
  return (
    <View>
      <Text>Mutual 12 de Septiembre</Text>

      <Text>Trabajando por el bienestar general</Text>
      <Formik>
        <View>
          <Text>Inicio de Sesion</Text>

          <TouchableOpacity
            style={style.container}
            onPress={handleNavigationToHome}
          >
            <Text style={style.text}>Salir</Text>
          </TouchableOpacity>
        </View>
      </Formik>
    </View>
  );
};

export default LoginScreen;

const style = StyleSheet.create({
  container: {
    marginHorizontal: 15,
    marginVertical: 15,
    width: 100,
    height: 30,
    borderRadius: 8,
    backgroundColor: "#000",
    justifyContent: "center",
    alignItems: "center",
  },
  text: {
    textAlign: "center",
    color: "#fff",
    fontSize: 15,
    fontWeight: "bold",
  },
});
